@ZiggyZiggyvdb Ik ben geen veganist maar vegetariër. 
De enige reden dat ik geen vlees eet is omdat ik razend bent over het leed dat dieren wordt aangedaan en razend op de vlees maffia die I liefst zelf in de slachthuizen ondersteboven zie hangen .
Niet omdat ik geen vlees meer zou lusten..

