Je kunt dit argument niet eens verdedigen omdat onze fysiologie helemaal niet is ingesteld om alleen plantjes te eten en DAT zie je dus aan vrijwel elke vegan!

Ze komen nutriënten te kort. DAT is wetenschap. Niet de mening van een veganist met een titel!

